import './Navigation.css';
import { NavLink } from 'react-router-dom';

function Navigation(props) {
  return (

       <nav class='Navigation'>



        <ul className='Navigation__links'>
            <NavLink className='Navigation__link' activeClassName='Navigation__link_active' exact to='/'>Home</NavLink>
               <NavLink className='Navigation__link' activeClassName='Navigation__link_active'>Saved Articles</NavLink>
               <button onClick={props.onSigninClick}>Sign in</button>
                <button onClick={props.onSignoutClick}> <span className='nav__btn-username'>Username{/*will need to be props.username in stage-3*/}</span> </button>

       </ul>
     </nav>

        )
}

export default Navigation;
